import React from 'react';
import {
  BrowserRouter,
  Route,
  Switch
} from 'react-router-dom';
import MovieList from './MovieList';
import './App.css';

function App() {
  return (
    <BrowserRouter>
    <div className="App">
      <header className="App-header">
        <div>Movie App</div>
      </header>
      <Route exact path="/" component={MovieList}/>
    </div>
    </BrowserRouter>
  );
}

export default App;
